import './App.css';

function Alert() {
  return (
    <div className="alert">hey</div>
  );
}

function App() {
  return (
    <div className="App">
      <div className="setup">
        <p>Alert Setup</p>
        <input type="checkbox">Header</input>

      </div>
      <div className="examples">
        <div className="example">
          <p>Current</p>
          <Alert />
        </div>
        <div className="example">
          <p>New</p>
          <Alert />
        </div>
      </div>
    </div>
  );
}

export default App;
